import React, { useState } from "react";
import { Link } from "react-router-dom";

function Login() {
  const [showPassword, setShowPassword] = useState(false);

  const togglePassword = () => setShowPassword((prev) => !prev);

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: handle login logic
  };

  return (
    <div className="container d-flex justify-content-center align-items-center" style={{ minHeight: "100vh" }}>
      <div className="border rounded p-4 shadow-sm position-relative" style={{ width: "100%", maxWidth: "420px" }}>
        {/* Logo + Rocket */}
        <div className="text-center mb-3">
          <img src="/media/images/logo.svg" alt="Logo" style={{ height: "24px" }} />
          <h2 className="mt-4 fw-bold">Log in</h2>
        </div>

        <img
          src="/media/images/rocket.png"
          alt="rocket"
          style={{
            position: "absolute",
            top: "10px",
            right: "10px",
            width: "50px"
          }}
        />

        {/* Google and Facebook buttons */}
        <div className="d-flex justify-content-between mb-3">
          <button className="btn btn-light border w-100 me-2 d-flex align-items-center justify-content-center gap-2">
            <img src="https://img.icons8.com/color/16/google-logo.png" alt="google" />
            Google
          </button>
          <button className="btn btn-light border w-100 ms-2 d-flex align-items-center justify-content-center gap-2">
            <img src="https://img.icons8.com/fluency/16/facebook-new.png" alt="facebook" />
            Facebook
          </button>
        </div>

        {/* Divider */}
        <div className="d-flex align-items-center mb-3">
          <hr className="flex-grow-1" />
          <span className="mx-2 text-muted">or</span>
          <hr className="flex-grow-1" />
        </div>

        {/* Login Form */}
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="email" className="form-label fw-semibold">
              Email
            </label>
            <input type="email" id="email" className="form-control" placeholder="Enter email" required />
          </div>

          <div className="mb-3 position-relative">
            <label htmlFor="password" className="form-label fw-semibold">
              Password
            </label>
            <input
              type={showPassword ? "text" : "password"}
              id="password"
              className="form-control pe-5"
              placeholder="Enter password"
              required
            />
            <span
              onClick={togglePassword}
              style={{ position: "absolute", right: "15px", top: "38px", cursor: "pointer" }}
            >
              {showPassword ? (
                <i className="fa fa-eye-slash"></i>
              ) : (
                <i className="fa fa-eye"></i>
              )}
            </span>
            <div className="text-end mt-1">
              <Link to="/forgot-password" className="text-primary text-decoration-none">
                Forgot password?
              </Link>
            </div>
          </div>

          <button type="submit" className="btn btn-dark w-100 fw-bold mt-3">
            Log in
          </button>
        </form>

        <p className="text-center mt-4">
          Donâ€™t have an account?{" "}
          <Link to="/signup" className="signin-btn">
            Sign In
</Link>

        </p>
      </div>
    </div>
  );
}

export default Login;
